  public default_val(
    val: any,
    default_val: any,
    digitsInfo: string = undefined
  ) {
    // console.log('default_val', val, default_val, digitsInfo);
    if (val === undefined) {
      return default_val;
    } else if (isNaN(val)) {
      return val;
    } else if (digitsInfo) {
      return formatNumber(val, "en-US", digitsInfo);
    } else {
      return val;
    }
  }
